INSERT INTO `ysk_hyxz` VALUES (4,'会员须知','1、会员通过微信扫描二维码（或通过微信点击链接）进入界面。首充1000元，确认并提交。即可成为会员。\r\n2、会员费为100元整。会员充值成功后会自动扣除。\r\n3、本平台充值返佣为1%。\r\n4、本平台实行推荐返佣机制，除自身反应外，一级推荐二级，一级按二级总返佣20%进行提成。二级推荐三级。二级按三级总返佣的10%进行提成。\r\n5、会员资格不得转借、转让或以其他方式供第三方使用。\r\n6、加入会员，即代表授权同意接收与会员相关的信息，原则上会员资格永久有效，会员也可以自由选择终止会员资格，终止时不退还会员费。\r\n7、如遇到系统问题，充值问题，可随时联系客服或代理商进行解决。\r\n8、本平台运行时间为：10:00——22:00整。\r\n9、会员所有权及解释权属本平台所有。');
/*!40000 ALTER TABLE `ysk_hyxz` ENABLE KEYS */;
UNLOCK TABLES;

